import React, {useState} from 'react';
import PhotoIcon from '@material-ui/icons/PhotoOutlined';
import makeStyles from "@material-ui/core/styles/makeStyles";
import CardModalContentBox from "./CardModalContentBox";
import Grid from "@material-ui/core/Grid";
import IconButton from "@material-ui/core/IconButton";
import FavoriteBorderIcon from "@material-ui/icons/FavoriteBorder";
import Paging from "../../navigations/Paging";

const useStyles = makeStyles(theme => ({
    gridItem: {
        position: 'relative',
    },
    imageBox: {
        position: 'relative',
    },
    dummyHeight: {
        marginTop: '100%',
    },
    squareImage: {
        width: 'calc(calc(90vw - 52px) / 2)',
        height: 'calc(calc(90vw - 52px) / 2)',
        objectFit: 'cover',
        position: 'absolute',
        top: '5px',
        right: '5px',
        bottom: '30px', // bottomDiv.height + 5px
        left: '5px',
        border: '1px solid #adb5bd',
    },

    iconButton: {
        padding: 0,
        marginRight: '4px',
    },
    imageInfoBox: {
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
    },
}));

const CardGallery = () => {
    const classes = useStyles();
    const [state] = useState({
        page: 1,
        data: [
            {
                image: 'data:image/jpeg;base64,',
                heartCount: 500,
                userLike: true,
            },
            {
                image: 'data:image/jpeg;base64,',
                heartCount: 307,
                userLike: false,
            },
            {
                image: 'data:image/jpeg;base64,',
                heartCount: 20,
                userLike: true,
            },
            {
                image: 'data:image/jpeg;base64,',
                heartCount: 12,
                userLike: true,
            },
            {
                image: 'data:image/jpeg;base64,',
                heartCount: 420,
                userLike: false,
            },
            {
                image: 'https://img.huffingtonpost.com/asset/5c6faf3f2400000802a29788.jpeg?cache=9hFsR6xOXO&ops=scalefit_630_noupscale',
                heartCount: 99,
                userLike: false,
            },
        ],
    });

    const GridItems = state.data.map(({image, heartCount, userLike}, idx) => {
        return (
            <Grid item xs={6} key={idx} className={classes.gridItem}>
                <div className={classes.dummyHeight}></div>
                <img src={image} alt="사진" className={classes.squareImage} />
                <div className={classes.imageInfoBox}>
                    <IconButton
                        className={classes.iconButton}
                        //onClick={handleClick}
                    >
                        <FavoriteBorderIcon />
                    </IconButton>
                    {heartCount}
                </div>
            </Grid>
        );
    });

    return (
        <CardModalContentBox
            title="대표사진"
            icon={<PhotoIcon className="title-icon" />}
        >
            <Grid container>
                { GridItems }
            </Grid>

            <Paging/>
        </CardModalContentBox>
    );
};

export default CardGallery;